public String stringl(String A,int sz){
    String B = null;
    int si = A.length();
    if(sz<si)
        B = A.substring(0, sz);
    else{
        B=A;
        for(int sp=0;sp<sz-si;++sp){
            B=B+" ";
        }
    }
    //System.out.println("b:"+B+"/nA="+A);
   // System.out.println("Sz:"+sz+"/nsi="+si);
        return B;
}
public String stringc(String A,int sz){
    String B ;
    int si = A.length();
    if(sz<si)
        B = A.substring(0, sz);
    else{
        B=A;
        for(int sp=0;sp<0.5*(sz-si);++sp){
            B=" "+B;
        }
    }
    //System.out.println("b:"+B+"/nA="+A);
    //System.out.println("Sz:"+sz+"/nsi="+si);
        return B;
}
public String stringr(String A,int sz){
    String B ;
    int si = A.length();
    if(sz<si)
        B = A.substring(0, sz);
    else{
        B=A;
        for(int sp=0;sp<(sz-si);++sp){
            B=" "+B;
        }
    }
    //System.out.println("b:"+B+"/nA="+A);
    //System.out.println("Sz:"+sz+"/nsi="+si);
        return B;
}
